import React from "react";
import Header from './Layout/AppHeader';
import Footer from './Layout/AppFooter';
import SearchFilter from "./SearchFilter";

const Home = () => {
    return (
        <>
            <Header />
            <SearchFilter />
            <div className="grid grid-cols-1 sm:grid-cols-2 md:grid-cols-3 lg:grid-cols-4 gap-4 rounded-full">
                <div className="rounded-full overflow-hidden shadow-lg bg-white">
                    <img src='' className="w-full h-40 object-cover rounded-full" />
                    <div className="px-6 py-4">
                        <div className="font-bold text-xl mb-2">mnmm</div>
                        <p className="text-gray-700 text-base">$6565</p>
                    </div>
                    <div className="px-6 py-4">
                        <button className="bg-blue-500 hover:bg-blue-700 text-white font-bold py-2 px-4 rounded-full">
                            Add to Cart
                        </button>
                    </div>
                </div>
            </div>
            <Footer />
        </>
    )
}

export default Home;
